import { useState } from 'react'
import './Jogo.css'

const Jogo = ({ onVoltarClick, clubes }) => {
    return (
        <div className='quadrado'>
            <h1>Escolha um clube!</h1>
            <div>
                {clubes.map(clube => (
                    <button key={clube.id} onClick={() => console.log(`Você selecionou ${clube.nome}`)}>
                        {clube.nome}
                    </button>
                ))}
            </div>
            <div className='botao-canto'>
                <button onClick={onVoltarClick}>Voltar</button>
            </div>
        </div>
    );
}

export default Jogo;
